import Home from '../Componets/Home'
import About from '../Componets/About'
import {
    createBrowserRouter,
    RouterProvider,
} from "react-router-dom";
function Router() {
    const router = createBrowserRouter([
        {
            path: "/",
            element: <Home />,

        },
        {
            path: "/about-us",
            element: <About />

        }
    ]);
    return (
        <>
            {<RouterProvider router={router} />}
        </>
    )
}

export default Router
